import React from "react";

class SeasonDisplay extends React.Component {
    render() {
        window.navigator.geolocation.getCurrentPosition(
            position => console.log(position),
            err => console.log(err)
        );
        return <div>Latitude: </div>
    }
}

export default SeasonDisplay
